import React from 'react';
import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  NavLink
} from "react-router-dom";
import Home from './views/home.js'
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/home" component={Home}>
            <NavLink to="/home">Go to Home</NavLink>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}
export default App;
